// ...existing code...
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Page from "./menuAwal/Page";
import Indo from "./Indo"; // Pastikan path sesuai

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Page />} />
        <Route path="/indo" element={<Indo />} />
      </Routes>
    </Router>
  );
}
export default App;
